import React from "react";
import Card from "./Card";

function App(props) {
  return (
    <div>
      <h1 className="heading">My Contacts</h1>
      <Card name={props.name} img={props.imgURL} phone={props.phone} email={props.email} />
    </div>
  );
}

export default App;
